// 数据结构初始化函数 - 原名：InitializeSystemStateManager

void InitializeSystemData(void)

{
  char system_flag_initialization;
  uint64_t *system_node_root;
  int system_memory_comparison_result;
  longlong *system_data_pointer;
  longlong system_node_allocation_size;
  longlong system_node_total_allocation_size;
  uint64_t *system_node_current;
  uint64_t *system_node_previous;
  uint64_t *system_next_node;
  uint64_t *system_new_node;
  code *system_initialization_function;

  system_data_pointer = (longlong *)GetSystemDataBase();
  system_node_root = (uint64_t *)*system_data_pointer;
  system_flag_initialization = *(char *)((longlong)system_node_root[SYSTEM_NODE_INDEX_ROOT_NEXT] + NODE_INITIALIZED_OFFSET);
  system_initialization_function = InitializeGameData;
  system_node_previous = system_node_root;
  system_node_current = (uint64_t *)system_node_root[SYSTEM_NODE_INDEX_ROOT_NEXT];
  while (system_flag_initialization == SYSTEM_CHAR_NULL_TERMINATOR) {
    system_memory_comparison_result = memcmp(system_node_current + SYSTEM_NODE_DATA_OFFSET,&gameDataDefaultPattern,SYSTEM_DATA_COMPARE_SIZE);
    if (system_memory_comparison_result < SYSTEM_COMPARE_RESULT_EQUAL) {
      system_next_node = (uint64_t *)system_node_current[SYSTEM_NODE_INDEX_CURRENT_PREV];
      system_node_current = system_node_previous;
    }
    else {
      system_next_node = (uint64_t *)*system_node_current;
    }
    system_node_previous = system_node_current;
    system_node_current = system_next_node;
    system_flag_initialization = *(char *)((longlong)system_next_node + NODE_INITIALIZED_OFFSET);
  }
  if ((system_node_previous == system_node_root) || (system_memory_comparison_result = memcmp(&gameDataDefaultPattern,system_node_previous + SYSTEM_NODE_DATA_OFFSET,SYSTEM_DATA_COMPARE_SIZE), system_memory_comparison_result < SYSTEM_COMPARE_RESULT_EQUAL)) {
    system_node_allocation_size = AllocateNodeMemory(system_data_pointer);
    InsertSystemNode(system_data_pointer,&system_new_node,system_node_previous,system_node_total_allocation_size + SYSTEM_NODE_HEADER_SIZE,system_node_allocation_size);
    system_node_previous = system_new_node;
  }
  system_node_previous[SYSTEM_NODE_INDEX_SIGNATURE_PRIMARY] = dataNodeSignaturePrimary;
  system_node_previous[SYSTEM_NODE_INDEX_SIGNATURE_SECONDARY] = dataNodeSignatureSecondary;
  system_node_previous[SYSTEM_NODE_INDEX_DEFAULT_FUNCTION] = &defaultInitializationFunction;
  system_node_previous[SYSTEM_NODE_INDEX_STATUS_FLAG] = SYSTEM_ENGINE_TYPE_DEFAULT;
  system_node_previous[SYSTEM_NODE_INDEX_INITIALIZATION_FUNCTION] = system_initialization_function;
  return;
}
